sessions.session_desc:
Featuring the cars of the IMSA WeatherTech SportsCar Championship, the BMW M Hybrid V8, Dallara P217 LMP2 and a fleet of GT3/GTD cars take on 160 minutes of action at marquee tracks around the world. From historic European circuits to the fun and exciting rounds in North America, the combination of these cars, tracks, and race length will put even the best road racers to the test. 

